import React from "react";

import classes from './Croquis.module.css'

function Croquis(props) {
  let forma = null;
    console.log(props.respaldo.forma)
  switch (props.respaldo.forma) {
    case "Rectangular":
      forma = (
        <svg
        className={classes.forma} 
          width="110"
          height="62"
          viewBox="0 0 110 62"
          fill="none"
          xmlns="http://www.w3.org/2000/svg"
        >
          <rect
            x="0.5"
            y="0.5"
            width="108"
            height="61"
            fill="#FFFDFD"
            stroke="#111"
            stroke-width="0.2px"
          />
        </svg>
      );
      break;
case "Capilla":
        forma = (
            <svg className={classes.forma}  width="110" height="63" viewBox="0 0 110 63" fill="none" xmlns="http://www.w3.org/2000/svg">
            <path stroke-width="0.2px" d="M0.5 61.75V13.1128C16.3815 4.88015 37.6709 0.749999 58 0.749999C78.3336 0.749998 97.6036 4.88149 109.5 13.0713V61.75H0.5Z" fill="white" stroke="#1a1a1a"/>
            </svg>
        );
        break;
case "Oval":
            forma = (
                <svg className={classes.forma}  width="50" height="75" viewBox="0 0 50 75" fill="none" xmlns="http://www.w3.org/2000/svg">
                <path stroke-width="0.01px" d="M49.5 37.5C49.5 47.7704 46.7238 57.0459 42.2616 63.7392C37.7971 70.4359 31.6844 74.5 25 74.5C18.3156 74.5 12.2029 70.4359 7.73836 63.7392C3.27617 57.0459 0.5 47.7704 0.5 37.5C0.5 27.2296 3.27617 17.9541 7.73836 11.2608C12.2029 4.56407 18.3156 0.5 25 0.5C31.6844 0.5 37.7971 4.56407 42.2616 11.2608C46.7238 17.9541 49.5 27.2296 49.5 37.5Z" fill="white" stroke="#1a1a1a"/>
                </svg>
            );
            break;
case "Esquinas Redondas":
           forma = (
            <svg className={classes.forma} width="110" height="62" viewBox="0 0 110 62" fill="none" xmlns="http://www.w3.org/2000/svg">
            <rect stroke-width="0.2px" x="0.5" y="0.5" width="109" height="61" rx="14.5" fill="white" stroke="#1a1a1a"/>
            </svg>
                );
                break;
    default:
        forma =" Por favor seleccione una forma para comenzar "
      break;
  }
  return <div className={classes.Croquis}>
      {forma}
  </div>;
}

export default Croquis;
